syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";

import "Vector.proto";

message EvtFixedRushMove {
	repeated uint32 AnimatorStateIdList = 14;
	bool CheckAnimatorStateOnExitOnly = 9;
	float speed = 11;
	string OverrideCollider = 13;
	uint32 entityId = 1;
	bool NeedSetIsInAir = 15;
	Vector TargetPos = 7;
}
